import React from "react";
import "./navbar.css";
// import Grid from '@mui/material/Grid';

export default class Navbar extends React.Component {

  componentDidMount() {
    const Ulkitscript1 = document.createElement("script");
    Ulkitscript1.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit.min.js";
    Ulkitscript1.async = true;

    const Ulkitscript2 = document.createElement("script");
    Ulkitscript2.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit-icons.min.js";
    Ulkitscript2.async = true;

    document.body.appendChild(Ulkitscript1);
    document.body.appendChild(Ulkitscript2);

    function erasePadding(){
      const stickyNavbar = document.querySelector(".uk-sticky");
      return this.scrollY > 215 ? stickyNavbar.style.paddingTop = "0%" : null;
    }

    window.addEventListener("scroll", erasePadding , false);
  }




  render() {


    return (

      <div className="uk-section-primary uk-preserve-color">

        <div uk-sticky="animation: uk-animation-slide-top; sel-target: .uk-navbar-container; cls-active: uk-navbar-sticky; cls-inactive: uk-navbar-transparent uk-light; top: 200">

          <nav className="uk-navbar-container">
            <div className="uk-container uk-container-expand">
              <div uk-navbar="true">

                <ul className="uk-navbar-nav">

                  <li className="uk-active">

                    <a href="/" id="logo-a">
                      <img
                        id="icon"
                        src="https://img.icons8.com/external-vitaliy-gorbachev-blue-vitaly-gorbachev/60/000000/external-bird-st-patrick-day-vitaliy-gorbachev-blue-vitaly-gorbachev.png"
                        alt=""
                      />
                      ExamBird
                    </a>

                  </li>

                  <li><a className="disable-padding" href="/"> Login </a></li>

                  <li><a href="/">About</a></li>
                </ul>

              </div>
            </div>
          </nav>
        </div>

        <div className="uk-section uk-light">
          <div className="uk-container">

            <div className="uk-child-width-1-3@m uk-grid-small uk-grid-match" uk-grid="true">
              <div>
                <div className="uk-card uk-card-default uk-card-body uk-card-hover">
                <img src="https://img.icons8.com/flat-round/64/000000/bird--v1.png"/>
                  <h3 className="uk-card-title">Light</h3>
                  <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</p>
                </div>
              </div>
              <div>
                <div className="uk-card uk-card-primary uk-card-body uk-card-hover">
                <img src="https://img.icons8.com/emoji/48/000000/eagle--v2.png"/>                  
                <h3 className="uk-card-title">Eagle Eye</h3>
                  <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</p>
                </div>
              </div>
              <div>
                <div className="uk-card uk-card-secondary uk-card-body uk-card-hover">
                <img alt="" src="https://img.icons8.com/external-justicon-flat-justicon/64/000000/external-bird-funeral-justicon-flat-justicon.png"/>
                  <h3 className="uk-card-title">Responsive</h3>
                  <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</p>
                </div>
              </div>
            </div>


          </div>
        </div>

      </div>

